int maxSubarrayLength(int* nums, int numsSize, int k) {
    int maxLength = 0;
    for (int i = 0; i < numsSize; ++i) {
        int freq[10] = {0}, count = 0;
        for (int j = i; j < numsSize; ++j) {
            if (freq[nums[j] % 10] < k) {
                freq[nums[j] % 10]++;
                count++;
            } else {
                break;
            }
            maxLength = maxLength > count ? maxLength : count;
        }
    }
    return maxLength;
}
